from .conf import mock_l0_api_responses, network

@pytest.mark.mock
class TestMockedL0API:
    """Test L0 API endpoints with mocked responses"""

    @pytest.mark.asyncio
    async def test_get_address_balance(self, network, httpx_mock: HTTPXMock, mock_l0_api_responses):
        network.config("integrationnet")
        address = "DAG0zJW14beJtZX2BY2KA9gLbpaZ8x6vgX4KVPVX"
        httpx_mock.add_response(url="https://l0-lb-integrationnet.constellationnetwork.io/dag/DAG0zJW14beJtZX2BY2KA9gLbpaZ8x6vgX4KVPVX/balance",
                                json=mock_l0_api_responses["address_balance"])
        result = await network.get_address_balance(address)
        assert result.model_dump() == {'ordinal': 3381908, 'balance': 5699930, 'address': None, 'meta': None}

    @pytest.mark.asyncio
    async def test_get_total_supply(self, network, httpx_mock: HTTPXMock, mock_l0_api_responses):
        network.config("integrationnet")
        httpx_mock.add_response(url="https://l0-lb-integrationnet.constellationnetwork.io/dag/total-supply",
                                json=mock_l0_api_responses["total_supply"])
        result = await network.l0_api.get_total_supply()
        assert result.model_dump() == {'ordinal': 3381985, 'total_supply': 97227345262286877}

    @pytest.mark.asyncio
    async def test_get_cluster_info(self, network, httpx_mock: HTTPXMock, mock_l0_api_responses):
        network.config("integrationnet")
        httpx_mock.add_response(url="https://l0-lb-integrationnet.constellationnetwork.io/cluster/info",
                                json=mock_l0_api_responses["cluster_info"])
        results = await network.l0_api.get_cluster_info()
        assert [r.model_dump() for r in results] == [{'alias': None, 'id': '615b72d69facdbd915b234771cd4ffe49692a573f7ac05fd212701afe9b703eb8ab2ab117961f819e6d5eaf5ad073456cf56a0422c67b17606d95f50460a919d', 'ip': IPv4Network('5.161.233.213/32'), 'state': 'Ready', 'session': 1748983955866, 'public_port': 9000, 'p2p_port': 9001, 'reputation': None}]

